import React from "react";
import cakeImg from '..';

const cakes = [
  { name: "Chocolate cake", link: "", image: {cakeImg} },
  { name: "?", link: "", image: "../images/icons/cake-512x512.png" },
  { name: "Mudcake", link: "mudcake", image: "../images/icons/cake-512x512.png" },
  { name: "?", link: "", image: "../images/icons/cake-512x512.png" }
];

/**
 * <div className="card">
            bild
            <img className="card--avatar" src={image} />
            <h1 className="card--title">{name}</h1>
            <a className="card--link">Try</a>
          </div>
 */

const App = () => {
  if ("serviceWorker" in navigator) {
    window.addEventListener("load", function() {
      navigator.serviceWorker
        .register("/serviceWorker.js")
        .then(res => console.log("service worker registered"))
        .catch(err => console.log("service worker not registered", err));
    });
  }

  return (
    <>
      <div>nddsj</div>
      {cakes.map(({name, image}) => (
         <div className="card">
         <img className="card--avatar" src={image} />
         <h1 className="card--title">{name}</h1>
         <a className="card--link">Try</a>
       </div>
      ))}
    </>
  );
};

export default App;
